div.div:
thread_info 是其中一个字段，它包含了与特定线程相关的信息，
相关字段解释：
`thread_info` 结构体包含了以下一些重要的字段：
1. `task`: 指向包含线程信息的 `task_struct` 结构体的指针。这允许内核通过 `thread_info` 结构找到与之关联的整个 `task_struct` 数据。
2. `cpu`: 表示线程所在的 CPU 核心编号。这对于线程的调度和处理器亲和性很重要，使得内核可以更好地决定将线程调度到哪个核心上执行。
3. `preempt_count`: 一个计数器，用于跟踪内核抢占（preemption）操作的数量。在内核中，抢占是指强制中断当前正在运行的任务，然后转而执行其他任务。`preempt_count` 的增加表示当前线程不希望被抢占，从而可以在一些关键代码段中防止被中断。当计数器归零时，线程可以被抢占。
4. `addr_limit`: 一个内存地址限制，用于确保线程只能访问其地址空间内的合法内存范围。这是一种安全机制，用于防止线程访问不属于自己的内存区域。
5. `flags`: 包含一些标志位，用于表示线程的状态和属性。例如，这些标志可以表示线程是否在用户态运行、是否在系统调用中等。
总之，`thread_info` 结构体存储了与线程相关的关键信息，帮助内核进行线程调度、内存访问控制和抢占等操作。这些信息有助于操作系统管理并执行多个线程，以实现并发和多任务处理。
使用方式参考
#include <linux/sched.h>
void process_thread_info(void) {
struct thread_info *ti;
// 获取当前线程的 thread_info 结构
ti = current_thread_info();
// 获取当前线程的 CPU 核心编号
int cpu = ti->cpu;
// 获取当前线程的地址限制
unsigned long addr_limit = ti->addr_limit;
// 获取当前线程的状态标志
unsigned long flags = ti->flags;
// 进行一些处理，例如打印获取到的信息
printk("Thread on CPU: %d\n", cpu);
printk("Address Limit: 0x%lx\n", addr_limit);
printk("Thread Flags: 0x%lx\n", flags);
}
